(18, 245, NULL, NULL, NULL, NULL, NULL, 1, 'Harcovna', 'CZE', 'yr1990226@yahoo.com', 'www.yr1990226.com', '123456789', '1111', 'Ostravice', 'ASFDADFG', '739 11', 'Provaznická 5, 746 01 Opava, Česká republika', NULL, '49.94065980', '17.89479890', NULL, NULL, NULL, '2', '1', '1', '0100', 'Nejlepší restaurace ve FnO', 'Hostinec – penzion Na Harcovně patří v atraktivní oblasti podhůří Moravskoslezských Beskyd mezi nejstarší. Podle záznamů v dobové kronice sahá jeho bohatá historie až do konce 18. století.\n\nNabídka našich služeb je zaměřena především na kvalitní gastronomii. Můžete u nás ochutnat z širokého výběru hotových jídel, specialit kuchyně krajové i světové, vegetariánská jídla, dezerty, moučníky, poháry – zkrátka vše, na co si jen vzpomenete.\n\nDále Vám můžeme nabídnout pestrou škálu kvalitních zahraničních a jihomoravských vín, alkoholických, nealkoholických i míchaných nápojů.\n\nAť už pořádáte rodinnou oslavu, firemní večírek, nebo se pouze příjemně unaveni vracíte z Lysé hory, dveře hostince Na Harcovně jsou pro Vás vždy dokořán – Tož vitájte!', '2016-10-17 19:27:33', '2017-08-31 15:09:50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'Kč', '*23AE809DDACAF96AF0FD78ED04B6A265E05AA257', 1, 1, NULL, '0.2.40', '120.00', '1900.00', '19.00', 1, b'1', '1.00'),
