(75, 166, NULL, NULL, NULL, NULL, NULL, 1, 'SURFBAR restaurant', 'ENG', 'surfbarjedovnice@email.cz', 'www.surfbar.cz', '+420773972759', '773972759', 'Riviera 524', 'Jedovnice', '67906', 'Riviera 524, 679 06 Jedovnice, Česko', NULL, '49.33784160', '16.76154390', NULL, 'Surfbar Jedovnice', NULL, NULL, '75755530', '261352610', '0300', 'home kitchen, garden sittings, playground', 'Our motto is "Teamwork"\n\nThe team is formed by people who are interested in work of gastronomy, they love it and educate themselves. They like to make coffee - barista, wine serving - sommelier and everything connected with gastronomy.\n\nSURFBAR Restaurant\n\nThe pub and restaurant with a traditional name, nonsmoking pleasant atmosphere, quality cuisine, large selection of wines and great beer. You will be served always friendly staff that offer high quality and tasty meals that delight both the eye and the soul. Cooks for you Tomas Ulbrich, a chef with many years OF experience who has a respect, understanding and love for the food.\nWhy we doing this?\nBecause we want to offer an experience the atmosphere in which they feel comfortable and a place to come back. It is also important that we enjoy it and look forward to work.\n\nWhere are we?\nThe picturesque hamlet named Jedovnice at a beautiful pond named Olšovec. We are part of a protected area of the Moravian Karst.', '2017-05-03 06:39:19', '2017-05-03 06:39:19', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A', 'EUR', NULL, 1, 1, NULL, NULL, '130.00', '1900.00', '15.00', 2, b'1', '1.00'),
