INSERT INTO `sync_serv_init` (`ID`, `lang`, `create_SQL`, `version`, `base_version`) VALUES
(1, 'ENG', '--  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- \n--  Hostitel:                     127.0.0.1\n--  Verze serveru:                5.7.16-log - MySQL Community Server (GPL)\n--  OS serveru:                   Win32\n--  HeidiSQL Verze:               9.4.0.5138\n--  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- \n\n/*!40101 SET @OLD_CHARACTER_SET_CLIENT=@@CHARACTER_SET_CLIENT */;\n/*!40101 SET NAMES utf8 */;\n/*!50503 SET NAMES utf8mb4 */;\n/*!40014 SET @OLD_FOREIGN_KEY_CHECKS=@@FOREIGN_KEY_CHECKS, FOREIGN_KEY_CHECKS=0 */;\n/*!40101 SET @OLD_SQL_MODE=@@SQL_MODE, SQL_MODE=''NO_AUTO_VALUE_ON_ZERO'' */;\n\n-- alergen\nDROP TABLE IF EXISTS `alergen`;\nCREATE TABLE IF NOT EXISTS `alergen` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `idx` tinyint(4) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;\n\n\n-- chat\nDROP TABLE IF EXISTS `chat`;\nCREATE TABLE IF NOT EXISTS `chat` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders` int(11) DEFAULT NULL,\n  `ID_orders_detail` int(11) DEFAULT NULL,\n  `datetime` datetime DEFAULT CURRENT_TIMESTAMP,\n  `from_client` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-from restaurant, 1- from client'',\n  `chat_message` text NOT NULL,\n  `is_read` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_chat` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;\n\n\n-- client\nDROP TABLE IF EXISTS `client`;\nCREATE TABLE `client` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_user` int(11) NOT NULL,\n  `ID_diet` int(11) DEFAULT NULL,\n  `email_new` tinyint(4) NOT NULL DEFAULT ''1'',\n  `email_update` tinyint(4) NOT NULL DEFAULT ''0'',\n  `email_restaurant_update` tinyint(4) NOT NULL DEFAULT ''1'',\n  `address` varchar(100) DEFAULT NULL,\n  `location` varchar(100) DEFAULT NULL,\n  `latitude` decimal(10,8) DEFAULT NULL,\n  `longitude` decimal(10,8) DEFAULT NULL,\n  `phone` varchar(50) DEFAULT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;\n\n\n-- color_set\nDROP TABLE IF EXISTS `color_set`;\nCREATE TABLE `color_set` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `scheme` int(11) NOT NULL DEFAULT ''0'',\n  `order_unpaid` char(6) NOT NULL DEFAULT ''FFFF00'',\n  `order_part_paid` char(6) NOT NULL DEFAULT ''0000FF'',\n  `order_fully_paid` char(6) NOT NULL DEFAULT ''00FF00'',\n  `order_overpaid` char(6) NOT NULL DEFAULT ''FF0000'',\n  `order_finalized` char(6) NOT NULL DEFAULT ''00FF00'',\n  `order_menu_list` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_public_menu` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_request_menu` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_diet_cook` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_recipe` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_restaurant` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_client` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_date` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `ingredient_public` char(6) NOT NULL DEFAULT ''00FFFF'',\n  `ingredient_notpublic` char(6) NOT NULL DEFAULT ''FFFF00'',\n  `ingredient_menu` char(6) NOT NULL DEFAULT ''ADFF2F'',\n  `lang` char(3) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- cook_style\nDROP TABLE IF EXISTS `cook_style`;\nCREATE TABLE IF NOT EXISTS `cook_style` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `cust_order` smallint(4) NOT NULL DEFAULT ''0'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;\n\n\n-- diet\nDROP TABLE IF EXISTS `diet`;\nCREATE TABLE IF NOT EXISTS `diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `cust_order` tinyint(1) NOT NULL DEFAULT ''0'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;\n\n\n-- ingredient\nDROP TABLE IF EXISTS `ingredient`;\nCREATE TABLE IF NOT EXISTS `ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_ingredient_group` int(11) DEFAULT NULL,\n  `ID_alergen` int(11) DEFAULT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_ingredient` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=utf8;\n\n\n-- ingredient_group\nDROP TABLE IF EXISTS `ingredient_group`;\nCREATE TABLE IF NOT EXISTS `ingredient_group` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;\n\n\n-- kitchen_type\nDROP TABLE IF EXISTS `kitchen_type`;\nCREATE TABLE IF NOT EXISTS `kitchen_type` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `cust_order` tinyint(3) NOT NULL DEFAULT ''0'',\n  `last_update` timestam