yint(1) NOT NULL DEFAULT ''0'' COMMENT ''values -1..7 (-1 - scheduled, 0 - cooked every day, 1 cooked Monday only...7 Sunday only)'',\n  `time_from` time NOT NULL COMMENT ''výdej jídla od - hodina'',\n  `time_to` time NOT NULL COMMENT ''výdej jídla do - hodina'',\n  `book_from` tinyint(4) NOT NULL COMMENT ''objednávka jídla od, 1-7 dní ve dnech'',\n  `book_to` datetime NOT NULL COMMENT ''objednávka jídla do, cca 24-0 v hodinách'',\n  `book_latest` TIME NULL,\n  `cancel_until` datetime NOT NULL COMMENT ''zrušení zdarma do - hodin'',\n  `price` decimal(8,2) NOT NULL COMMENT ''cena porce'',\n  `price_child` decimal(8,2) DEFAULT NULL COMMENT ''cena dětské porce'',\n  `max_portions` smallint(6) DEFAULT NULL,\n  `comment` text COMMENT ''popis jídla'',\n  `cust_order` tinyint(4) NOT NULL,\n  `delivered` tinyint(1) NOT NULL DEFAULT ''0'',\n  `pick_up` char(1) NOT NULL DEFAULT ''N'',\n  `lang` char(3) NOT NULL,\n  `currency` char(3) NOT NULL DEFAULT ''EUR'',\n  `isActive` tinyint(1) NOT NULL DEFAULT ''1'',\n  `item_type` char(1) NOT NULL DEFAULT ''M'' COMMENT ''M-meal, D-drink, O-other'',\n  `supplement_to` int(11) DEFAULT NULL COMMENT ''ID menu_list of main meal'',\n  `supplement_price` decimal(8,2) DEFAULT NULL COMMENT ''price of supplement, usually 0 (soup to main manu)'',\n  `supplement_before` char(1) DEFAULT NULL COMMENT ''Y-before main meal (soup), N-after (cake,coffee etc.)'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `photo` varchar(50) DEFAULT NULL,\n  `side_dish` char(1) NOT NULL DEFAULT ''N'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_list` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8;\n\n\n-- menu_schedule\nDROP TABLE IF EXISTS `menu_schedule`;\nCREATE TABLE IF NOT EXISTS `menu_schedule` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `datetime_from` datetime NOT NULL,\n  `datetime_to` datetime NO