ime DEFAULT NULL,\n  `partner` varchar(20) DEFAULT NULL,\n  `req_number` int(11) DEFAULT NULL,\n  `gb_discount` decimal(8,2) DEFAULT NULL COMMENT ''discount by us (quiz, acquisition etc.)'',\n  `color_message` char(6) DEFAULT NULL COMMENT ''HEX RGB color of order'',  \n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;\n\n\n-- orders_cook_style\nDROP TABLE IF EXISTS `orders_cook_style`;\nCREATE TABLE IF NOT EXISTS `orders_cook_style` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders_detail` int(11) NOT NULL,\n  `ID_cook_style` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `status` tinyint(2) NOT NULL DEFAULT ''0'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders_cook_style` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;\n\n\n-- orders_detail\nDROP TABLE IF EXISTS `orders_detail`;\nCREATE TABLE IF NOT EXISTS `orders_detail` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders` int(11) NOT NULL,\n  `ID_client` int(11) NOT NULL,\n  `ID_menu_list` int(11) DEFAULT NULL,\n  `ID_request_menu` int(11) DEFAULT NULL,\n  `ID_public_menu` int(11) DEFAULT NULL,\n  `x_number` tinyint(4) NOT NULL DEFAULT ''1'',\n  `serve_at` datetime NOT NULL COMMENT ''čas jídla'',\n  `price` decimal(8,2) NOT NULL,\n  `currency` CHAR(3) DEFAULT NULL,\n  `is_child` tinyint(4) NOT NULL DEFAULT ''0'',\n  `modified` timestamp NULL DEFAULT ''0000-00-00 00:00:00'',\n  `status` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-new, 1-sent, 2-confirmed, 3-cancelled, 4-finalized'',\n  `ID_menu_list_old` int(11) NULL,\n  `comment` text COMMENT ''poznámka klienta k objednávce'',\n  `side_dish` int(11) DEFAULT NULL COMMENT ''copy of ID_orders_detail of the main dish'',\n  `req_number` int(11