n  `datetime` datetime NOT NULL,\n  `type` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-card'',\n  `amount` decimal(8,2) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_ingredient\nDROP TABLE IF EXISTS `public_ingredient`;\nCREATE TABLE IF NOT EXISTS `public_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_public_menu` int(11) NOT NULL,\n  `ID_ingredient` int(11) NOT NULL,\n  `amount` varchar(30) DEFAULT NULL,\n  `unit` varchar(2) DEFAULT NULL COMMENT ''g, ml'',\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;\n\n\n-- public_menu\nDROP TABLE IF EXISTS `public_menu`;\nCREATE TABLE IF NOT EXISTS `public_menu` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_kitchen_type` int(11) DEFAULT NULL,\n  `ID_cook_style` int(11) DEFAULT NULL,\n  `prefix` varchar(20) NOT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `instruction` text,\n  `ID_public_menu_group` int(11) DEFAULT NULL COMMENT ''group for public search'',\n  `ID_client` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_menu_diet\nDROP TABLE IF EXISTS `public_menu_diet`;\nCREATE TABLE IF NOT EXISTS `public_menu_diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_public_menu` int(11) NOT NULL,\n  `ID_diet` int(11) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_menu_group\nDROP TABLE IF EXISTS `public_menu_group`;\nCREATE TABLE IF NOT EXISTS `public_menu_group` (\n