iquekey_idserver_rooms` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- room_object\nDROP TABLE IF EXISTS `room_object`;\nCREATE TABLE IF NOT EXISTS `room_object` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_rooms` int(11) NOT NULL,\n  `object_type` char(1) NOT NULL COMMENT ''O,D,W-outline,door,window'',\n  `from_X` tinyint(4) NOT NULL,\n  `from_Y` tinyint(4) NOT NULL,\n  `to_X` tinyint(4) NOT NULL,\n  `to_Y` tinyint(4) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_room_object` (`ID_server`)\n) ENGINE=MyISAM DEFAULT CHARSET=utf8;\n\n\n-- synch_deletions\nDROP TABLE IF EXISTS `synch_deletions`;\nCREATE TABLE IF NOT EXISTS `synch_deletions` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `tablename` varchar(100) NOT NULL,\n  `ID_server` varchar(100) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `hash_string` varchar(100),\n  `salt` varchar(100),\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=282 DEFAULT CHARSET=utf8;\n\n\n-- tables\nDROP TABLE IF EXISTS `tables`;\nCREATE TABLE IF NOT EXISTS `tables` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_rooms` int(11) NOT NULL,\n  `name` varchar(10) NOT NULL,\n  `seats` tinyint(4) NOT NULL,\n  `shape` tinyint(4) NOT NULL,\n  `size` tinyint(4) NOT NULL,\n  `from_X` tinyint(4) NOT NULL,\n  `from_Y` tinyint(4) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_tables` (`ID_server`)\n) ENGINE=MyISAM DEFAULT CHARSET=utf8;\n\n\n-- user\nDROP TABLE IF EXISTS `user`;\nCREATE TABLE IF NOT EXISTS `user` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL,\n  `email` varchar(60) COLLATE utf8_unicode_ci NOT NULL,\n  `password` varchar(60) COLLATE utf8_unicode_ci NOT NULL,\n  `phone` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `profile_type` varchar(20) COLLATE utf8_unicode_ci NOT NULL,\n  `token` VARCHAR(255) NOT NULL,\n  `created_at` timestamp NULL DEFAULT NULL,\n  `updated_at` timestamp NULL DEFAULT NULL,\n  `deleted_at` timestamp NULL DEFAULT NULL,\n  PRIMARY KEY (`id`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\n\n-- log\nCREATE TABLE IF NOT EXISTS `log` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) NOT NULL,\n  `type` varchar(20) DEFAULT ''ERROR'',\n  `location` varchar(2000) default null,\n  `text` varchar(2000) default null,\n  `created_at` timestamp(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3),\n  `synched` tinyint DEFAULT 0,\n  PRIMARY KEY (`ID`)\n  -- UNIQUE KEY `uniquekey_idserver_menu_list` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=180 DEFAULT CHARSET=utf8;\n\n\n/*\n--  Exportování struktury pro trigger pizzacz.menu_cook_style_after_delete\nDROP TRIGGER IF EXISTS `menu_cook_style_after_delete`;\nSET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE=''STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION'';\nDELIMITER //\nCREATE TRIGGER `menu_cook_style_after_delete` AFTER DELETE ON `menu_cook_style` FOR EACH ROW INSERT INTO synch_deletions ( tablename, ID_server)\nVALUES   ( ''menu_cook_style'', old.ID_server )//\nDELIMITER ;\nSET SQL_MODE=@OLDTMP_SQL_MODE;\n\n--  Exportování struktury pro trigger pizzacz.menu_diet_after_delete\nDROP TRIGGER IF EXISTS `menu_diet_after_delete`;\nSET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE=''STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION'';\nDELIMITER //\nCREATE TRIGGER `menu_diet_after_delete` AFTER DELETE ON `menu_diet` FOR EACH ROW INSERT INTO synch_deletions ( tablename, ID_server)\nVALUES   ( ''menu_diet'', old.ID_server )//\nDELIMITER ;\nSET SQL_MODE=@OLDTMP_SQL_MODE;\n\n--  Exportování struktury pro trigger pizzacz.menu