  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(50) NOT NULL,\n  `item_type` CHAR(1) NOT NULL DEFAULT ''M'',\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- requests\nDROP TABLE IF EXISTS `requests`;\nCREATE TABLE IF NOT EXISTS `requests` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) DEFAULT NULL,\n  `ID_orders` int(11) NOT NULL,\n  `status` char(1) NOT NULL DEFAULT ''N'' COMMENT ''N-new, S-sent to client, A-accepted by client, C-cancelled by client, E-cancelled by restaurant'',\n  `new_restaurant` varchar(50) DEFAULT NULL,\n  `new_address` text,\n  `unread` char(1) NOT NULL DEFAULT ''C'' COMMENT ''C-client, R-restaurant, N-noone, both read'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\n\n\n-- request_ingredient\nDROP TABLE IF EXISTS `request_ingredient`;\nCREATE TABLE IF NOT EXISTS `request_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_request_menu` int(11) NOT NULL,\n  `ID_ingredient` int(11) NOT NULL,\n  `amount` varchar(30) DEFAULT NULL,\n  `unit` varchar(2) DEFAULT NULL COMMENT ''g, ml'',\n  `ID_ingredient_confirmed` int(11) DEFAULT NULL,\n  `amount_confirmed` varchar(30) DEFAULT NULL,\n  `unit_confirmed` varchar(2) DEFAULT NULL,\n  `status_confirmed` char(1) DEFAULT ''N'' COMMENT ''N-new, C-confirmed, D-deleted'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- request_menu\nDROP TABLE IF EXISTS `request_menu`;\nCREATE TABLE IF NOT EXISTS `request_menu` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `prefix` varchar(20) DEFAULT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `confirmed_name` varchar(50) DEFAULT NULL,\n  `comment` text,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- restaurant\nDROP TABLE IF EXISTS `restaurant`;\nCREATE TABLE IF NOT EXISTS `restaurant` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_user` int(11) NULL DEFAULT NULL,\n  `ID_restaurant_type` int(11) NOT NULL,\n  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `lang` char(3) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''ENG'',\n  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `www` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `phone` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `street` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `city` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `post_code` varchar(10) COLLATE utf8_unicode_ci NOT NULL,\n  `address_note` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `latitude` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `longitude` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `accept_payment` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `company_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `company_tax_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `account_number` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''115-2579350227'',\n  `bank_code` char(4) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''0100'',\n  `short_descr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `long_descr` text COLLATE utf8_unicode_ci NOT NULL,\n  `created_at` timestamp NULL DEFAULT NULL,\n  `updated_at` timestamp NULL DEFAULT NULL,\n  `deleted_at` timestamp NULL DEFAULT NULL,\n  `status` char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''N'' COMMENT ''N-new, A-active, T-testing, D-deleted'',\n  `currency` varchar(5) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''EUR'',\n  `last_remote_to_local` timestamp NOT NULL DEFAULT ''0000-00-00 00:00: