,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION'';\nDELIMITER //\nCREATE TRIGGER `tables_after_delete` AFTER DELETE ON `tables` FOR EACH ROW INSERT INTO synch_deletions ( tablename, ID_server)\nVALUES   ( ''tables'', old.ID_server )//\nDELIMITER ;\nSET SQL_MODE=@OLDTMP_SQL_MODE;\n*/\n/*!40101 SET SQL_MODE=IFNULL(@OLD_SQL_MODE, '''') */;\n/*!40014 SET FOREIGN_KEY_CHECKS=IF(@OLD_FOREIGN_KEY_CHECKS IS NULL, 1, @OLD_FOREIGN_KEY_CHECKS) */;\n/*!40101 SET CHARACTER_SET_CLIENT=@OLD_CHARACTER_SET_CLIENT */;\n\nDROP PROCEDURE IF EXISTS `AddColumn`;\nDELIMITER $$\nCREATE DEFINER=`menuexport`@`%` PROCEDURE `AddColumn`(in pTableName varchar(50), in pColName varchar(50), in pColDataType varchar(500))\nBEGIN\nSET @s = (SELECT IF(\n    (SELECT COUNT(*)\n        FROM INFORMATION_SCHEMA.COLUMNS\n        WHERE table_name = pTableName\n        AND table_schema = DATABASE()\n        AND column_name = pColName\n    ) > 0,\n    "SELECT 1",\n    concat(''ALTER TABLE '', pTableName, '' ADD '', pColName, '' '', pColDataType)\n));\n\nPREPARE stmt FROM @s;\nEXECUTE stmt;\nDEALLOCATE PREPARE stmt;\n\nEND$$\nDELIMITER ;\n\n\n', '1.7.9', '1.7.2');
