(3, 'NA', '--  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- \n--  Hostitel:                     127.0.0.1\n--  Verze serveru:                5.7.16-log - MySQL Community Server (GPL)\n--  OS serveru:                   Win32\n--  HeidiSQL Verze:               9.4.0.5138\n--  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- \n\n/*!40101 SET @OLD_CHARACTER_SET_CLIENT=@@CHARACTER_SET_CLIENT */;\n/*!40101 SET NAMES utf8 */;\n/*!50503 SET NAMES utf8mb4 */;\n/*!40014 SET @OLD_FOREIGN_KEY_CHECKS=@@FOREIGN_KEY_CHECKS, FOREIGN_KEY_CHECKS=0 */;\n/*!40101 SET @OLD_SQL_MODE=@@SQL_MODE, SQL_MODE=''NO_AUTO_VALUE_ON_ZERO'' */;\n\n-- alergen\nDROP TABLE IF EXISTS `alergen`;\nCREATE TABLE IF NOT EXISTS `alergen` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `idx` tinyint(4) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;\n\n\n-- chat\nDROP TABLE IF EXISTS `chat`;\nCREATE TABLE IF NOT EXISTS `chat` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders` int(11) DEFAULT NULL,\n  `ID_orders_detail` int(11) DEFAULT NULL,\n  `datetime` datetime DEFAULT CURRENT_TIMESTAMP,\n  `from_client` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-from restaurant, 1- from client'',\n  `chat_message` text NOT NULL,\n  `is_read` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_chat` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;\n\n\n-- client\nDROP TABLE IF EXISTS `client`;\nCREATE TABLE `client` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_user` int(11) NOT NULL,\n  `ID_diet` int(11) DEFAULT NULL,\n  `email_new` tinyint(4) NOT NULL DEFAULT ''1'',\n  `email_update` tinyint(4) NOT NULL DEFAULT ''0'',\n  `email_restaurant_update` tinyint(4) NOT NULL DEFAULT ''1'',\n  `address` varchar(100) DEFAULT NULL,\n  `location` varchar(100) DEFAULT NULL,\n  `latitude` decimal(10,8) DEFAULT NULL,\n  `longitude` decimal(10,8) DEFAULT NULL,\n  `phone` varchar(50) DEFAULT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;\n\n\n-- color_set\nDROP TABLE IF EXISTS `color_set`;\nCREATE TABLE `color_set` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `scheme` int(11) NOT NULL DEFAULT ''0'',\n  `order_unpaid` char(6) NOT NULL DEFAULT ''FFFF00'',\n  `order_part_paid` char(6) NOT NULL DEFAULT ''0000FF'',\n  `order_fully_paid` char(6) NOT NULL DEFAULT ''00FF00'',\n  `order_overpaid` char(6) NOT NULL DEFAULT ''FF0000'',\n  `order_finalized` char(6) NOT NULL DEFAULT ''00FF00'',\n  `order_menu_list` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_public_menu` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_request_menu` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_diet_cook` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_recipe` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_restaurant` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_client` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `order_chat_date` char(6) NOT NULL DEFAULT ''FFFFFF'',\n  `ingredient_public` char(6) NOT NULL DEFAULT ''00FFFF'',\n  `ingredient_notpublic` char(6) NOT NULL DEFAULT ''FFFF00'',\n  `ingredient_menu` char(6) NOT NULL DEFAULT ''ADFF2F'',\n  `lang` char(3) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- cook_style\nDROP TABLE IF EXISTS `cook_style`;\nCREATE TABLE IF NOT EXISTS `cook_style` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `cust_order` smallint(4) NOT NULL DEFAULT ''0'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;\n\n\n-- diet\nDROP TABLE IF EXISTS `diet`;\nCREATE TABLE IF NOT EXISTS `diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `cust_order` tinyint(1) NOT NULL DEFAULT ''0'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;\n\n\n-- ingredient\nDROP TABLE IF EXISTS `ingredient`;\nCREATE TABLE IF NOT EXISTS `ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_ingredient_group` int(11) DEFAULT NULL,\n  `ID_alergen` int(11) DEFAULT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_ingredient` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=utf8;\n\n\n-- ingredient_group\nDROP TABLE IF EXISTS `ingredient_group`;\nCREATE TABLE IF NOT EXISTS `ingredient_group` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;\n\n\n-- kitchen_type\nDROP TABLE IF EXISTS `kitchen_type`;\nCREATE TABLE IF NOT EXISTS `kitchen_type` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `cust_order` tinyint(3) NOT NULL DEFAULT ''0'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;\n\n\n-- menu_cook_style\nDROP TABLE IF EXISTS `menu_cook_style`;\nCREATE TABLE IF NOT EXISTS `menu_cook_style` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `ID_cook_style` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_cook_style` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;\n\n\n-- menu_diet\nDROP TABLE IF EXISTS `menu_diet`;\nCREATE TABLE IF NOT EXISTS `menu_diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `ID_diet` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_diet` (`ID_server`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\n\n\n-- menu_group\nDROP TABLE IF EXISTS `menu_group`;\nCREATE TABLE IF NOT EXISTS `menu_group` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_type` int(11) NOT NULL,\n  `name` varchar(200) NOT NULL,\n  `cust_order` tinyint(4) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_group` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=295 DEFAULT CHARSET=utf8;\n\n\n-- menu_ingredient\nDROP TABLE IF EXISTS `menu_ingredient`;\nCREATE TABLE IF NOT EXISTS `menu_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `prefix_ingredient` varchar(20) DEFAULT NULL,\n  `ID_ingredient` int(11) NOT NULL COMMENT ''základní surovina - informace bez možnosti zmeny, pokud není nic v alternativách'',\n  `optional` char(1) NOT NULL DEFAULT ''N'',\n  `amount` decimal(5,1) DEFAULT NULL,\n  `unit` char(2) DEFAULT NULL,\n  `prefix_ingredient_alt1` varchar(20) DEFAULT NULL,\n  `ID_ingredient_alt1` int(11) DEFAULT NULL COMMENT ''alternativa k surovině'',\n  `amount_alt1` decimal(5,1) DEFAULT NULL,\n  `alt1_active` tinyint(4) NOT NULL DEFAULT ''1'' COMMENT ''vypínač alternativy'',\n  `prefix_ingredient_alt2` varchar(20) DEFAULT NULL,\n  `ID_ingredient_alt2` int(11) DEFAULT NULL,\n  `amount_alt2` decimal(5,1) DEFAULT NULL,\n  `alt2_active` tinyint(4) NOT NULL DEFAULT ''1'',\n  `prefix_ingredient_alt3` varchar(20) DEFAULT NULL,\n  `ID_ingredient_alt3` int(11) DEFAULT NULL,\n  `amount_alt3` decimal(5,1) DEFAULT NULL,\n  `alt3_active` tinyint(4) NOT NULL DEFAULT ''1'',\n  `last_new_price` decimal(5,2) DEFAULT NULL COMMENT ''last price set for ingredient new on dish'',\n  `last_extra_price` decimal(5,2) DEFAULT NULL COMMENT ''last price set for ingredient extra on dish'',\n  `last_less_price` decimal(5,2) DEFAULT NULL COMMENT ''last price set for ingredient less on dish'',\n  `last_without_price` decimal(5,2) DEFAULT NULL COMMENT ''last price set for ingredient taken away from dish'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_ingredient` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- menu_list\nDROP TABLE IF EXISTS `menu_list`;\nCREATE TABLE IF NOT EXISTS `menu_list` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) NOT NULL,\n  `ID_public_menu` int(11) DEFAULT NULL,\n  `ID_menu_subgroup` int(11) NOT NULL COMMENT ''subgroup id'',\n  `ID_kitchen_type` int(11) DEFAULT NULL,\n  `prefix` varchar(20) DEFAULT NULL COMMENT ''popiska množství apod. (100g)'',\n  `name` varchar(200) NOT NULL COMMENT ''název jídla'',\n  `is_day_menu` tinyint(1) NOT NULL DEFAULT ''0'' COMMENT ''values -1..7 (-1 - scheduled, 0 - cooked every day, 1 cooked Monday only...7 Sunday only)'',\n  `time_from` time NOT NULL COMMENT ''výdej jídla od - hodina'',\n  `time_to` time NOT NULL COMMENT ''výdej jídla do - hodina'',\n  `book_from` tinyint(4) NOT NULL COMMENT ''objednávka jídla od, 1-7 dní ve dnech'',\n  `book_to` datetime NOT NULL COMMENT ''objednávka jídla do, cca 24-0 v hodinách'',\n  `book_latest` TIME NULL,\n  `cancel_until` datetime NOT NULL COMMENT ''zrušení zdarma do - hodin'',\n  `price` decimal(8,2) NOT NULL COMMENT ''cena porce'',\n  `price_child` decimal(8,2) DEFAULT NULL COMMENT ''cena dětské porce'',\n  `max_portions` smallint(6) DEFAULT NULL,\n  `comment` text COMMENT ''popis jídla'',\n  `cust_order` tinyint(4) NOT NULL,\n  `delivered` tinyint(1) NOT NULL DEFAULT ''0'',\n  `pick_up` char(1) NOT NULL DEFAULT ''N'',\n  `lang` char(3) NOT NULL,\n  `currency` char(3) NOT NULL DEFAULT ''EUR'',\n  `isActive` tinyint(1) NOT NULL DEFAULT ''1'',\n  `item_type` char(1) NOT NULL DEFAULT ''M'' COMMENT ''M-meal, D-drink, O-other'',\n  `supplement_to` int(11) DEFAULT NULL COMMENT ''ID menu_list of main meal'',\n  `supplement_price` decimal(8,2) DEFAULT NULL COMMENT ''price of supplement, usually 0 (soup to main manu)'',\n  `supplement_before` char(1) DEFAULT NULL COMMENT ''Y-before main meal (soup), N-after (cake,coffee etc.)'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `photo` varchar(50) DEFAULT NULL,\n  `side_dish` char(1) NOT NULL DEFAULT ''N'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_list` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8;\n\n\n-- menu_schedule\nDROP TABLE IF EXISTS `menu_schedule`;\nCREATE TABLE IF NOT EXISTS `menu_schedule` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `datetime_from` datetime NOT NULL,\n  `datetime_to` datetime NOT NULL,\n  `max_portions` smallint(6) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_schedule` (`ID_server`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\n\n\n-- menu_side_dish\nDROP TABLE IF EXISTS `menu_side_dish`;\nCREATE TABLE IF NOT EXISTS `menu_side_dish` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_list` int(11) NOT NULL,\n  `ID_menu_list_side_dish` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `sd_order` int(11),\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- menu_subgroup\nDROP TABLE IF EXISTS `menu_subgroup`;\nCREATE TABLE IF NOT EXISTS `menu_subgroup` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_menu_group` int(11) NOT NULL,\n  `name` varchar(400) NOT NULL,\n  `cust_order` tinyint(4) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_subgroup` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=389 DEFAULT CHARSET=utf8;\n\n\n-- menu_type\nDROP TABLE IF EXISTS `menu_type`;\nCREATE TABLE IF NOT EXISTS `menu_type` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(40) NOT NULL,\n  `cust_order` tinyint(4) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `public` tinyint(4) NOT NULL DEFAULT ''0'',\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_type` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=99 DEFAULT CHARSET=utf8;\n\n\n-- menu_visual_order\nDROP TABLE IF EXISTS `menu_visual_order`;\nCREATE TABLE IF NOT EXISTS `menu_visual_order` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `level` int(2) NOT NULL,\n  `ID_item` int(11) NOT NULL,\n  `cust_order` int(11) NOT NULL,\n  `ID_restaurant` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_menu_visual_order` (`ID_server`),\n  CONSTRAINT UC1_menu_visual_order UNIQUE (level, id_item)\n) ENGINE=MyISAM AUTO_INCREMENT=84 DEFAULT CHARSET=utf8;\n\n\n-- no_orders\nDROP TABLE IF EXISTS `no_orders`;\nCREATE TABLE IF NOT EXISTS `no_orders` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) NOT NULL,\n  `start` datetime NOT NULL,\n  `until` datetime NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_no_orders` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;\n\n\n-- orders\nDROP TABLE IF EXISTS `orders`;\nCREATE TABLE IF NOT EXISTS `orders` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) DEFAULT NULL,\n  `ID_client` int(11) NOT NULL,\n  `ID_tables` int(11) DEFAULT NULL,\n  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,\n  `updated_at` timestamp NULL DEFAULT ''0000-00-00 00:00:00'',\n  `order_number` smallint(6) NOT NULL COMMENT ''day number 1 - 999 (every day from 1)'',\n  `comment` text COMMENT ''client comment'',\n  `status` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-new, 1-sent, 2-confirmed, 3-cancelled, 4-finalized'',\n  `ID_server` int(11) DEFAULT NULL,\n  `persons` tinyint(3) NOT NULL DEFAULT ''1'',\n  `delivery_address` varchar(100) DEFAULT NULL,\n  `delivery_phone` varchar(20) DEFAULT NULL,\n  `delivery_latitude` decimal(10,8) DEFAULT NULL,\n  `delivery_longitude` decimal(10,8) DEFAULT NULL,\n  `pick_up` char(1) NOT NULL DEFAULT ''N'',\n  `table_until` datetime DEFAULT NULL,\n  `partner` varchar(20) DEFAULT NULL,\n  `req_number` int(11) DEFAULT NULL,\n  `gb_discount` decimal(8,2) DEFAULT NULL COMMENT ''discount by us (quiz, acquisition etc.)'',\n  `color_message` char(6) DEFAULT NULL COMMENT ''HEX RGB color of order'',  \n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;\n\n\n-- orders_cook_style\nDROP TABLE IF EXISTS `orders_cook_style`;\nCREATE TABLE IF NOT EXISTS `orders_cook_style` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders_detail` int(11) NOT NULL,\n  `ID_cook_style` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `status` tinyint(2) NOT NULL DEFAULT ''0'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders_cook_style` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;\n\n\n-- orders_detail\nDROP TABLE IF EXISTS `orders_detail`;\nCREATE TABLE IF NOT EXISTS `orders_detail` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders` int(11) NOT NULL,\n  `ID_client` int(11) NOT NULL,\n  `ID_menu_list` int(11) DEFAULT NULL,\n  `ID_request_menu` int(11) DEFAULT NULL,\n  `ID_public_menu` int(11) DEFAULT NULL,\n  `x_number` tinyint(4) NOT NULL DEFAULT ''1'',\n  `serve_at` datetime NOT NULL COMMENT ''čas jídla'',\n  `price` decimal(8,2) NOT NULL,\n  `currency` CHAR(3) DEFAULT NULL,\n  `is_child` tinyint(4) NOT NULL DEFAULT ''0'',\n  `modified` timestamp NULL DEFAULT ''0000-00-00 00:00:00'',\n  `status` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-new, 1-sent, 2-confirmed, 3-cancelled, 4-finalized'',\n  `ID_menu_list_old` int(11) NULL,\n  `comment` text COMMENT ''poznámka klienta k objednávce'',\n  `side_dish` int(11) DEFAULT NULL COMMENT ''copy of ID_orders_detail of the main dish'',\n  `req_number` int(11) DEFAULT NULL,\n  `sale_price` decimal(8,2) DEFAULT NULL,\n  `commission` decimal(3,1) DEFAULT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `recommended_side_dish` TINYINT NOT NULL DEFAULT ''0'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders_detail` (`ID_server`)\n) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;\n\n\n-- orders_diet\nDROP TABLE IF EXISTS `orders_diet`;\nCREATE TABLE IF NOT EXISTS `orders_diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders_detail` int(11) NOT NULL,\n  `ID_diet` int(11) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `status` tinyint(2) NOT NULL DEFAULT ''0'',\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders_diet` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;\n\n\n-- orders_ingredient\nDROP TABLE IF EXISTS `orders_ingredient`;\nCREATE TABLE IF NOT EXISTS `orders_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders_detail` int(11) NOT NULL,\n  `ID_ingredient` int(11) NOT NULL,\n  `kind` tinyint(4) NOT NULL COMMENT ''0-new, 1-extra, 2-less, 3-without'',\n  `status` tinyint(4) NOT NULL COMMENT ''0-new, 1-sent, 2-confirmed, 3-cancelled'',\n  `price` decimal(5,2) DEFAULT NULL COMMENT ''positive or negative'',\n  `comment` varchar(50) DEFAULT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `req_unit` varchar(2) DEFAULT NULL,\n  `conf_amount` varchar(30) DEFAULT NULL,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_orders_ingredient` (`ID_server`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=''změněné suroviny'';\n\n\n-- payment\nDROP TABLE IF EXISTS `payment`;\nCREATE TABLE IF NOT EXISTS `payment` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_orders` int(11) NOT NULL,\n  `datetime` datetime NOT NULL,\n  `type` tinyint(4) NOT NULL DEFAULT ''0'' COMMENT ''0-card'',\n  `amount` decimal(8,2) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_ingredient\nDROP TABLE IF EXISTS `public_ingredient`;\nCREATE TABLE IF NOT EXISTS `public_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_public_menu` int(11) NOT NULL,\n  `ID_ingredient` int(11) NOT NULL,\n  `amount` varchar(30) DEFAULT NULL,\n  `unit` varchar(2) DEFAULT NULL COMMENT ''g, ml'',\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;\n\n\n-- public_menu\nDROP TABLE IF EXISTS `public_menu`;\nCREATE TABLE IF NOT EXISTS `public_menu` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_kitchen_type` int(11) DEFAULT NULL,\n  `ID_cook_style` int(11) DEFAULT NULL,\n  `prefix` varchar(20) NOT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `instruction` text,\n  `ID_public_menu_group` int(11) DEFAULT NULL COMMENT ''group for public search'',\n  `ID_client` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_menu_diet\nDROP TABLE IF EXISTS `public_menu_diet`;\nCREATE TABLE IF NOT EXISTS `public_menu_diet` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_public_menu` int(11) NOT NULL,\n  `ID_diet` int(11) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- public_menu_group\nDROP TABLE IF EXISTS `public_menu_group`;\nCREATE TABLE IF NOT EXISTS `public_menu_group` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(50) NOT NULL,\n  `item_type` CHAR(1) NOT NULL DEFAULT ''M'',\n  `lang` char(3) NOT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- requests\nDROP TABLE IF EXISTS `requests`;\nCREATE TABLE IF NOT EXISTS `requests` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) DEFAULT NULL,\n  `ID_orders` int(11) NOT NULL,\n  `status` char(1) NOT NULL DEFAULT ''N'' COMMENT ''N-new, S-sent to client, A-accepted by client, C-cancelled by client, E-cancelled by restaurant'',\n  `new_restaurant` varchar(50) DEFAULT NULL,\n  `new_address` text,\n  `unread` char(1) NOT NULL DEFAULT ''C'' COMMENT ''C-client, R-restaurant, N-noone, both read'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8;\n\n\n-- request_ingredient\nDROP TABLE IF EXISTS `request_ingredient`;\nCREATE TABLE IF NOT EXISTS `request_ingredient` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_request_menu` int(11) NOT NULL,\n  `ID_ingredient` int(11) NOT NULL,\n  `amount` varchar(30) DEFAULT NULL,\n  `unit` varchar(2) DEFAULT NULL COMMENT ''g, ml'',\n  `ID_ingredient_confirmed` int(11) DEFAULT NULL,\n  `amount_confirmed` varchar(30) DEFAULT NULL,\n  `unit_confirmed` varchar(2) DEFAULT NULL,\n  `status_confirmed` char(1) DEFAULT ''N'' COMMENT ''N-new, C-confirmed, D-deleted'',\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- request_menu\nDROP TABLE IF EXISTS `request_menu`;\nCREATE TABLE IF NOT EXISTS `request_menu` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `prefix` varchar(20) DEFAULT NULL,\n  `name` varchar(50) NOT NULL,\n  `lang` char(3) NOT NULL,\n  `confirmed_name` varchar(50) DEFAULT NULL,\n  `comment` text,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`)\n) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;\n\n\n-- restaurant\nDROP TABLE IF EXISTS `restaurant`;\nCREATE TABLE IF NOT EXISTS `restaurant` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_user` int(11) NULL DEFAULT NULL,\n  `ID_restaurant_type` int(11) NOT NULL,\n  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `lang` char(3) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''ENG'',\n  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `www` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `phone` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `street` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `city` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `post_code` varchar(10) COLLATE utf8_unicode_ci NOT NULL,\n  `address_note` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `latitude` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `longitude` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `accept_payment` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `company_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `company_tax_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `account_number` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''115-2579350227'',\n  `bank_code` char(4) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''0100'',\n  `short_descr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `long_descr` text COLLATE utf8_unicode_ci NOT NULL,\n  `created_at` timestamp NULL DEFAULT NULL,\n  `updated_at` timestamp NULL DEFAULT NULL,\n  `deleted_at` timestamp NULL DEFAULT NULL,\n  `status` char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''N'' COMMENT ''N-new, A-active, T-testing, D-deleted'',\n  `currency` varchar(5) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''EUR'',\n  `last_remote_to_local` timestamp NOT NULL DEFAULT ''0000-00-00 00:00:00'',\n  `password` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,\n  `version` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL,\n  PRIMARY KEY (`id`)\n) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\n\n\n-- restaurant_open\nDROP TABLE IF EXISTS `restaurant_open`;\nCREATE TABLE IF NOT EXISTS `restaurant_open` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) NOT NULL,\n  `date` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `m_starting_time` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `m_ending_time` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `a_starting_time` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `a_ending_time` varchar(30) COLLATE utf8_unicode_ci NOT NULL,\n  `created_at` timestamp NULL DEFAULT NULL,\n  `updated_at` timestamp NULL DEFAULT NULL,\n  `deleted_at` timestamp NULL DEFAULT NULL,\n  PRIMARY KEY (`id`)\n) ENGINE=InnoDB AUTO_INCREMENT=3566058 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\n\n\n-- restaurant_type\nDROP TABLE IF EXISTS `restaurant_type`;\nCREATE TABLE IF NOT EXISTS `restaurant_type` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `description` varchar(255) COLLATE utf8_unicode_ci NOT NULL,\n  `created_at` timestamp NULL DEFAULT NULL,\n  `updated_at` timestamp NULL DEFAULT NULL,\n  `deleted_at` timestamp NULL DEFAULT NULL,\n  `lang` char(3) COLLATE utf8_unicode_ci NOT NULL DEFAULT ''ENG'',\n  `cust_order` tinyint(3) NOT NULL DEFAULT ''127'',\n  PRIMARY KEY (`id`)\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;\n\n\n-- rooms\nDROP TABLE IF EXISTS `rooms`;\nCREATE TABLE IF NOT EXISTS `rooms` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_restaurant` int(11) NOT NULL,\n  `name` varchar(50) NOT NULL,\n  `size` smallint(6) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_rooms` (`ID_server`)\n) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;\n\n\n-- room_object\nDROP TABLE IF EXISTS `room_object`;\nCREATE TABLE IF NOT EXISTS `room_object` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_rooms` int(11) NOT NULL,\n  `object_type` char(1) NOT NULL COMMENT ''O,D,W-outline,door,window'',\n  `from_X` tinyint(4) NOT NULL,\n  `from_Y` tinyint(4) NOT NULL,\n  `to_X` tinyint(4) NOT NULL,\n  `to_Y` tinyint(4) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_room_object` (`ID_server`)\n) ENGINE=MyISAM DEFAULT CHARSET=utf8;\n\n\n-- synch_deletions\nDROP TABLE IF EXISTS `synch_deletions`;\nCREATE TABLE IF NOT EXISTS `synch_deletions` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `tablename` varchar(100) NOT NULL,\n  `ID_server` varchar(100) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  `hash_string` varchar(100),\n  `salt` varchar(100),\n  PRIMARY KEY (`ID`)\n) ENGINE=InnoDB AUTO_INCREMENT=282 DEFAULT CHARSET=utf8;\n\n\n-- tables\nDROP TABLE IF EXISTS `tables`;\nCREATE TABLE IF NOT EXISTS `tables` (\n  `ID` int(11) NOT NULL AUTO_INCREMENT,\n  `ID_rooms` int(11) NOT NULL,\n  `name` varchar(10) NOT NULL,\n  `seats` tinyint(4) NOT NULL,\n  `shape` tinyint(4) NOT NULL,\n  `size` tinyint(4) NOT NULL,\n  `from_X` tinyint(4) NOT NULL,\n  `from_Y` tinyint(4) NOT NULL,\n  `ID_server` int(11) DEFAULT NULL,\n  `last_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,\n  PRIMARY KEY (`ID`),\n  UNIQUE KEY `uniquekey_idserver_tables` (`ID_server`)\n) ENGINE=MyISAM DEFAULT CHARSET=utf8;\n\n\n-- user\nDROP TABLE IF EXISTS `user`;\nCREATE TABLE IF NOT EXISTS `user` (\n  `id` int(11) NOT NULL AUTO_INCREMENT,\n  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL,\n  `email` varchar(60) COLLATE utf8_unicode_ci