(10, 'ENG', 'DROP PROCEDURE IF EXISTS `AddColumn`;\nDELIMITER $$\nCREATE DEFINER=`menuexport`@`%` PROCEDURE `AddColumn`(in pTableName varchar(50), in pColName varchar(50), in pColDataType varchar(500))\nBEGIN\nSET @s = (SELECT IF(\n    (SELECT COUNT(*)\n        FROM INFORMATION_SCHEMA.COLUMNS\n        WHERE table_name = pTableName\n        AND table_schema = DATABASE()\n        AND column_name = pColName\n    ) > 0,\n    "SELECT 1",\n    concat(''ALTER TABLE '', pTableName, '' ADD '', pColName, '' '', pColDataType)\n));\n\nPREPARE stmt FROM @s;\nEXECUTE stmt;\nDEALLOCATE PREPARE stmt;\n\nEND$$\nDELIMITER ;\n\n\ncall AddColumn(''color_set'', ''ID_server'', ''int(11) DEFAULT NULL'');\ncall AddColumn(''orders'', ''ID_tables'', ''int(11) DEFAULT NULL'');\ncall AddColumn(''orders_ingredient'', ''req_unit'', ''varchar(2) DEFAULT NULL'');\ncall AddColumn(''orders_ingredient'', ''conf_amount'', ''varchar(30) DEFAULT NULL'');\ncall AddColumn(''orders_diet'', ''status'', "tinyint(2) NOT NULL DEFAULT ''0''");\ncall AddColumn(''orders_cook_Style'', ''status'', "tinyint(2) NOT NULL DEFAULT ''0''");\ncall AddColumn(''chat'', ''ID_orders_detail'', ''int(11) DEFAULT NULL'');\n\n', '1.7.2'),
(11, 'CZE', 'DROP PROCEDURE IF EXISTS `AddColumn`;\nDELIMITER $$\nCREATE DEFINER=`menuexport`@`%` PROCEDURE `AddColumn`(in pTableName varchar(50), in pColName varchar(50), in pColDataType varchar(500))\nBEGIN\nSET @s = (SELECT IF(\n    (SELECT COUNT(*)\n        FROM INFORMATION_SCHEMA.COLUMNS\n        WHERE table_name = pTableName\n        AND table_schema = DATABASE()\n        AND column_name = pColName\n    ) > 0,\n    "SELECT 1",\n    concat(''ALTER TABLE '', pTableName, '' ADD '', pColName, '' '', pColDataType)\n));\n\nPREPARE stmt FROM @s;\nEXECUTE stmt;\nDEALLOCATE PREPARE stmt;\n\nEND$$\nDELIMITER ;\n\n\ncall AddColumn(''color_set'', ''ID_server'', ''int(11) DEFAULT NULL'');\ncall AddColumn(''orders'', ''ID_tables'', ''int(11) DEFAULT NULL'');\ncall AddColumn(''orders_ingredient'', ''req_unit'', ''varchar(2) DEFAULT NULL'');\ncall AddColumn(''orders_ingredient'', ''conf_amount'', ''varchar(30) DEFAULT NULL'');\ncall AddColumn(''orders_diet'', ''status'', "tinyint(2) NOT NULL DEFAULT ''0''");\ncall AddColumn(''orders_cook_Style'', ''status'', "tinyint(2) NOT NULL DEFAULT ''0''");\ncall AddColumn(''chat'', ''ID_orders_detail'', ''int(11) DEFAULT NULL'');\n\n', '1.7.2'),
