t` ADD `conf_unit` VARCHAR(2) NULL AFTER `conf_amount`;\n\n-- ALTER TABLE `client` ADD `show_patron` BIT(1) NOT NULL DEFAULT b''1'';\n-- ALTER TABLE `client` ADD `account_number` VARCHAR(50) NULL , ADD `bank_code` VARCHAR(4) NULL ;\n-- ALTER TABLE `user` ADD `social_password` VARCHAR(60) NULL , ADD `social_con_at` VARCHAR(60) NULL ;\n\n', '1.7.5');
